export default function Contact() {
  return (
    <section className="py-20 px-4 bg-gray-50 dark:bg-gray-900 text-gray-800 dark:text-white text-center">
      <h2 className="text-4xl font-bold mb-4">Contact</h2>
      <p className="text-lg mb-6">Feel free to reach out to me at:</p>
      <a href="mailto:kumaranikant24@gmail.com" className="text-blue-600 dark:text-blue-400 underline text-lg">
        kumaranikant24@gmail.com
        (7439907360)
      </a>
    </section>
  );
}
